import React from "react";
import classes from "./angleBtn.module.scss";
import AngleDown from "./icons/AngleDown";

const AngleBtn = ({ children, ...props }) => {
  return (
    <button
      style={{ border: `2px solid ${props.borderColor}`, backgroundColor: `${props.bgColor}` }}
      className={classes.angleBtn}
    >
      {children}
      <AngleDown style={{ color: `${props.angleColor}` }} />
    </button>
  );
};

export default AngleBtn;
